import React, { useState } from 'react';
import './Sidebar.css';

const Sidebar = ({ onFilterChange, onSearch }) => {
    const [searchQuery, setSearchQuery] = useState('');
    const [expandedSection, setExpandedSection] = useState(null);

    //  Funci贸n para mostrar/ocultar la descripci贸n
    const toggleSection = (section) => {
        setExpandedSection(expandedSection === section ? null : section);
    };

    return (
        <div className="sidebar">
            {/*  Secci贸n de b煤squeda */}
            <div className="search-section">
                <input
                    type="text"
                    placeholder="Buscar instrumento..."
                    className="search-input"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                />
                <button
                    className="andean-button"
                    onClick={() => onSearch(searchQuery)}
                >
                    Buscar
                </button>
            </div>

            {/*  Filtrar por tipo */}
            <div className="filters-section">
                <h3>Filtrar por tipo:</h3>
                <select onChange={(e) => onFilterChange(e.target.value)}>
                    <option value="all">Todos</option>
                    <option value="viento">Viento</option>
                    <option value="cuerda">Cuerda</option>
                    <option value="percusion">Percusi贸n</option>
                </select>
            </div>

            {/*  Secci贸n de T茅cnicas de ML con expansi贸n */}
            <div className="ml-techniques-section">
                <h3>T茅cnicas de ML</h3>

                {/*  Clasificaci贸n */}
                <button className="andean-button" onClick={() => toggleSection("clasificacion")}>
                    Clasificaci贸n
                </button>
                {expandedSection === "clasificacion" && (
                    <div className="expanded-section">
                        <img src="classification-diagram.png" alt="Proceso de Clasificaci贸n" className="ml-image" />
                        <p> <strong>Clasificaci贸n:</strong> Un algoritmo analiza el audio y determina a qu茅 categor铆a pertenece el instrumento.</p>
                        <ul>
                            <li> Se extraen caracter铆sticas ac煤sticas como espectrogramas.</li>
                            <li> Se aplican modelos de Machine Learning como Redes Neuronales.</li>
                            <li> El sistema decide si el instrumento es de viento, cuerda o percusi贸n.</li>
                        </ul>
                    </div>
                )}

                {/*  Identificaci贸n */}
                <button className="andean-button" onClick={() => toggleSection("identificacion")}>
                    Identificaci贸n
                </button>
                {expandedSection === "identificacion" && (
                    <div className="expanded-section">
                        <img src="identification-process3.jpg" alt="Proceso de Identificaci贸n" className="ml-image" />
                        <p> <strong>Identificaci贸n:</strong> Se detecta la presencia de un instrumento espec铆fico en una grabaci贸n de audio.</p>
                        <ul>
                            <li> Se analiza la se帽al de audio en tiempo real.</li>
                            <li> Se compara con una base de datos de sonidos de referencia.</li>
                            <li> Se determina si el instrumento es una quena, charango, bombo, etc.</li>
                        </ul>
                    </div>
                )}
            </div>

            {/*  Explicaci贸n de los Modelos de Machine Learning */}
            <div className="ml-explanation">
                <h3> Modelos de Machine Learning</h3>

                <button className="andean-button" onClick={() => toggleSection("cnn")}> Redes Neuronales Convolucionales (CNN)</button>
                {expandedSection === "cnn" && (
                    <div className="expanded-section">
                        <p>Las CNN procesan im谩genes de espectrogramas para identificar patrones ac煤sticos.</p>
                        <img src="/images/cnn_diagrama.png" alt="CNN para clasificaci贸n de audio" />
                    </div>
                )}

                <button className="andean-button" onClick={() => toggleSection("svm")}> M谩quina de Vectores de Soporte (SVM)</button>
                {expandedSection === "svm" && (
                    <div className="expanded-section">
                        <p>Las SVM encuentran una frontera 贸ptima entre distintas clases de instrumentos musicales.</p>
                        <img src="/images/svm_diagrama.png" alt="SVM en clasificaci贸n" />
                    </div>
                )}

                <button className="andean-button" onClick={() => toggleSection("multiclase")}> Clasificaci贸n Multiclase</button>
                {expandedSection === "multiclase" && (
                    <div className="expanded-section">
                        <p>El modelo predice la clase m谩s probable del instrumento musical entre m煤ltiples categor铆as.</p>
                        <img src="/images/multiclase_diagrama.png" alt="Clasificaci贸n multiclase" />
                    </div>
                )}
            </div>
        </div>
    );
};

export default Sidebar;
